public TaskSequence (PerfRunData runData, String name, TaskSequence parent, boolean parallel) {
  super(runData);
  name = (name!=null ? name : (parallel ? "Par" : "Seq"));
  setName(name);
  setSequenceName();
  this.parent = parent;
  this.parallel = parallel;
  tasks = new ArrayList();
}

